import React, { Component } from 'react'
//import * as ReactBS from 'react-bootstrap'

export default class ServicesCards extends React.Component {

  constructor (props) {
    super(props);
    this.state = {
      loading: false,
      posts: [],
      error: ''
    }
  }

  componentDidMount() {
    const url = 'http://vkovalov.me/wp-json/wp/v2/services';
    this.setState(
      { loading: true }, () =>{
        axios.get(url)
          .then(res => { 
              console.warn(res.data);
            }
          )
          .catch( 
            error => this.setState({ 
            loading: false, 
            error: '' 
          }))  
      }
    );
  }

  render() {
    return (
      <div>

      </div>
    )
  }
}
